    add \vC2\().2s, \vA2\().2s, \vB2\().2s
    add \vC4\().2s, \vA4\().2s, \vB4\().2s
    add \vC6\().2s, \vA6\().2s, \vB6\().2s
    add \vC8\().2s, \vA8\().2s, \vB8\().2s
